import React from "react";


function NavTab(props) {
    return (
            <div className="nav">
                <ul className="nav__container">
                    <li><a href="#project" className="nav__container-button">О проекте</a></li>
                    <li><a href="#techn" className="nav__container-button">Технологии</a></li>
                    <li><a href="#aboutme" className="nav__container-button">Студент</a></li>
                </ul>
            </div>     
    );
}

export default NavTab;
